import React, {Component} from 'react';
import './App.css';
import TodoItem from './components/TodoItem';

class App extends Component {

  constructor() {
    super();
    this.todoItems = [
      "Nấu cơm",
      "Giặt quần áo",
      "Đi chợ"
    ];
  }
  render () {  
  return (
    <div className="App">    
      {
        this.todoItems.map((item, index) => <TodoItem list={item} key={index}/>)
      }


    </div>
  );
  }
}

export default App;
